import React from 'react';
import './DustCard.css';
import pm10Img from '../assets/pm10.png';
import pm25Img from '../assets/pm25.png';

const DustCard = ({ dust }) => (
  <div className="dust-card">
    <h3>미세먼지 정보</h3>

    <div className="dust-item">
      <img src={pm10Img} alt="PM10" />
      <div className="dust-text">
        <p>미세먼지</p>
        <strong>{dust.pm10.value} µg/m³</strong>
        <p className="grade">{dust.pm10.grade}</p>
      </div>
    </div>

    <div className="dust-item">
      <img src={pm25Img} alt="PM2.5" />
      <div className="dust-text">
        <p>초미세먼지</p>
        <strong>{dust.pm25.value} µg/m³</strong>
        <p className="grade">{dust.pm25.grade}</p>
      </div>
    </div>
  </div>
);

export default DustCard;
